import React from 'react'
import '../Pokemon/Pokemon.css'
const Pokemon = ({posts, loading}) => {
   
    if (loading) {
        return <h2>Loading...</h2>;
      }
    
      return (
        <ul className=''>
          {posts.map(post => (
            <li key={post.id} className=''>
              {post.title}
            </li>
          ))}
        </ul>
      );
    };


export default Pokemon
